import {Box } from '@material-ui/core';
import { Grid , ButtonBase, Typography} from '@material-ui/core';
import {makeStyles} from "@material-ui/styles";
const useStyle = makeStyles({
    Grid:{
        justify:"center" ,
        alignItems:"center",
    },
});
export  default function Homepage(){
    return (
        <Grid container direction="row" justify="center" alignItems="center">
            <Grid container item xs={6} justify="center" alignItems="center">
                <Grid item xs={12}>
                    <Typography variant="h4"><strong>Year 6 maths programme</strong></Typography>
                </Grid>
                <Grid item xs={12}>
                    <Typography variant="subtitle1">Consolidating KS2</Typography>
                </Grid>
            </Grid>
            <Grid container item  xs={6} justify="center" alignItems="center">
                <Grid item alignItems="center">
                    <ButtonBase >
                        <img  alt="complex" src="/images/Homeschooling.jpg" style={{height:"60%", width:"60%",padding:100,borderRadius:120}}/>
                    </ButtonBase>
                </Grid>
            </Grid>
        </Grid>
    );
};
